const cabinetItem = (cabinet) => {
    return ( 
        <tr>
        <td>{cabinet.cabinet}</td>
        <td><Button onClick = {(e) => clickHandle(e)}>Выдать ключ</Button></td>
    </tr>
    );
};
export default cabinetItem;
